# Prompt: return first three numbers in input
# Given input as '+106 769-858-438' output is '106'

def extract_first_three_numbers(input_str):
    try:
        # Remove all non-numeric characters from the input string
        cleaned_input = ''.join(filter(str.isdigit, input_str))
        
        # Extract the first three characters from the cleaned input
        output = cleaned_input[:3]
        
        return output
    except Exception as e:
        return str(e)

